import Head from "next/head";
export default function Header() {
  return (
    <div>
      <Head>
        <title>Delivery</title>
        <link rel="icon" href="/favicon.ico" />
      </Head>
      <nav className="navBar">
        <div>Hello Nav Bar</div>
      </nav>
      <style jsx>{`
        * {
          box-sizing: border-box;
        }
      `}</style>
    </div>
  );
}
